​​​​헤르만 숄더백 튼튼하고 가벼운 기저귀가방으로 강추​​​​​아기기저귀가방 찾고 있었어요~~에코백처럼 가벼운 가방을 갖고 싶었는데 일반 에코백은 너무 흐물흐물하다고 해야 될까요?각도 없고 힘도 없어서 제스타일이 아니였어요그런데 헤르만 숄더백을 만나고 에코백에 대한 생각이 바뀌었답니다재질이 폴리에스테르인데 너무 탄탄하고 고급스러워요오염에 강한 소재라니 더 마음에 드네요디테일이랑 소가죽부분도 보세요~~너무 고급스럽지 않나요무게도 가벼워요 ~ 390g밖에 안한답니다~~가로 32, 세로37.5 , 넓이 10cm 로 크기도 너무 마음에 들어요~기본 에코백은 너무 작아서 a4용지 서류 넣으면 밖에 보이더라고요헤르만 숄더백은 크기도 넉넉해서 좋네요​손잡이 하나까지 신경썼다는게 느껴졌어요안쪽은 아무래도 손이 닿는부분이니깐 부드러운 실크같은 느낌의 천을 사용했고바깥쪽은 튼튼한 캔버스천이였어요헤르만 숄더백은 중국산제품이 아닌국내제작이랍니다.사용자의 마음을 어쩜 이렇게 잘 아시는지 자석부분이 너무 편했어요남자든 여자든학생이든 직장인이든남녀노소 나이불문 누구에게나 잘 어울릴만한헤르만 숄더백이에요서브백으로도 사용가능한실용만점 숄더백이쁘고 가볍고 튼튼하고 저렴하고 실용적이고만능 헤르만 숄더백 강추합니다!!​​​​​​​#튼튼한에코백 #남자에코백 #애코백브랜드 #남자숄더백 #여자숄더백 #남자가방 #브랜드 #숄더백 #에코백 #캔버스백 #캔버스기저귀가방​ 

